import React, { Component } from "react";
import "./index.css";
import NavBar from "./NavBar";
// import FooterApp from "./FooterApp";
import CardApp from "./CardApp";
import SearchboxApp from "./SearchboxApp";
import {
  BrowserRouter as Router,
  Route,
  Switch,
  Link,
  Redirect,
} from "react-router-dom";
import { InputGroup } from "react-bootstrap";
export default class App extends Component {
  render() {
    return (
      <>
        <NavBar />

        <div className="mainContainer">
          <Router>
            <switch>
              <Route path="/SearchboxApp" component={<SearchboxApp />} />
              <Route exact path="/CardApp" component={CardApp} />
            </switch>

            <div className={"fixed-bottom"} style={{ textAlign: "center" }}>
              <Button variant="primary">Search</Button>{" "}
              <Button variant="info">Stream</Button>{" "}
              <Button variant="success">Chat</Button>{" "}
              <Button variant="info">Alerts</Button>{" "}
            </div>
          </Router>
        </div>
      </>
    );
  }
}
